import * as React from 'react';
import './multiLevelDropdownMenu.scss';
import { Tabs } from './components';

type Submenu = {
  title: string;
  submenu?: Submenu;
}[];

type Title = {
  title: string;
  // submenu?: {
  //   title: string;
  // }[];
  submenu: Submenu;
};

const titles: Title[] = [
  {
    title: 'tab1',
    submenu: [
      {
        title: 'subtitle1',
      },
      {
        title: 'subtitle2',
      },
      {
        title: 'subtitle3',
        submenu: [
          {
            title: 'subSubtitle1',
          },
        ],
      },
    ],
  },
  {
    title: 'tab2',
  },
  {
    title: 'tab3',
  },
];
const MultiLevelDropdownMenu: React.FC = () => {
  return (
    <div className={'multi-level-dropdown-menu-wrapper'}>
      <Tabs titles={titles} />
    </div>
  );
};

export { MultiLevelDropdownMenu };
